def count_patterns(grid):
    rows = len(grid)
    cols = len(grid[0])
    p1 = 0  # xmas counter
    p2 = 0  # x-shaped mas counter
    
    for r in range(rows):
        for c in range(cols):
            # check for xmas in all directions
            if c+3 < cols:
                if grid[r][c:c+4] == 'XMAS': p1 += 1
                if grid[r][c:c+4] == 'SAMX': p1 += 1
            if r+3 < rows:
                if (grid[r][c] == 'X' and grid[r+1][c] == 'M' and 
                    grid[r+2][c] == 'A' and grid[r+3][c] == 'S'): p1 += 1
                if (grid[r][c] == 'S' and grid[r+1][c] == 'A' and 
                    grid[r+2][c] == 'M' and grid[r+3][c] == 'X'): p1 += 1
            if r+3 < rows and c+3 < cols:
                if (grid[r][c] == 'X' and grid[r+1][c+1] == 'M' and 
                    grid[r+2][c+2] == 'A' and grid[r+3][c+3] == 'S'): p1 += 1
                if (grid[r][c] == 'S' and grid[r+1][c+1] == 'A' and 
                    grid[r+2][c+2] == 'M' and grid[r+3][c+3] == 'X'): p1 += 1
            if r-3 >= 0 and c+3 < cols:
                if (grid[r][c] == 'X' and grid[r-1][c+1] == 'M' and 
                    grid[r-2][c+2] == 'A' and grid[r-3][c+3] == 'S'): p1 += 1
                if (grid[r][c] == 'S' and grid[r-1][c+1] == 'A' and 
                    grid[r-2][c+2] == 'M' and grid[r-3][c+3] == 'X'): p1 += 1
            
            # check for x-shaped mas
            if r+2 < rows and c+2 < cols:
                if (grid[r][c] == 'M' and grid[r+1][c+1] == 'A' and grid[r+2][c+2] == 'S' and 
                    grid[r+2][c] == 'M' and grid[r][c+2] == 'S'): p2 += 1
                if (grid[r][c] == 'M' and grid[r+1][c+1] == 'A' and grid[r+2][c+2] == 'S' and 
                    grid[r+2][c] == 'S' and grid[r][c+2] == 'M'): p2 += 1
                if (grid[r][c] == 'S' and grid[r+1][c+1] == 'A' and grid[r+2][c+2] == 'M' and 
                    grid[r+2][c] == 'M' and grid[r][c+2] == 'S'): p2 += 1
                if (grid[r][c] == 'S' and grid[r+1][c+1] == 'A' and grid[r+2][c+2] == 'M' and 
                    grid[r+2][c] == 'S' and grid[r][c+2] == 'M'): p2 += 1
    
    return p1, p2

def string_to_grid(text):
    return [line.strip() for line in text.strip().split('\n') if line.strip()]

# process input
p1, p2 = count_patterns(string_to_grid(text_input))
print(f"Number of XMAS/SAMX patterns: {p1}")
print(f"Number of X-shaped MAS/SAM patterns: {p2}")